  false,\n\t\"url\": null,\n\t\"notes\": \"Due to several recent organizational events
  in the Service and 8 years of Lake Ophelia/Grand Cote refuge management experience,
  there is a need to update past recommendations for habitat/biological programs.
  This current 1998 update focuses more on the overall biological opportunities, needs,
  and objectives of the refuges -- especially as related to the new Refuge Improvement
  Act of 1997. A more holistic look at where/how these two refuges could fit into
  the network of surrounding private lands, nearby State public lands, and the regional
  ecosystem was to be a priority consideration -- as well as the original purposes
  for establishing the refuges.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
